import React from "react";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <ul className="nav flex-column">
        <li className="nav-item">
       <button className="navbutton">   <Link className="" to="/">
            Home
          </Link></button>
        </li>
        <li className="nav-item">
        <button className="navbutton"><Link className="nav-link" to="/about">
            About
          </Link></button>
        </li>
        <li className="nav-item">
        <button className="navbutton">  <Link className="nav-link" to="/services">
            Services
          </Link></button>
        </li>
        <li className="nav-item">
        <button className="navbutton"> <Link className="nav-link" to="/contact">
            Contact
          </Link></button>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
